import { useState } from 'react';

export default function AddTask({onAddTask}) {

  let ss = ()=>{
    let text = "";
    let cabinet = "";
  };
  s = ss;
  const [s, setText] = useState('');  
  return (
    <>
      <input
        class="DescriptionTask"
        placeholder="Описание задачи"
        value={s.text}
        onChange={(e) =>setText(e.target.value)}
      />

      <input
        class="NumberCabinet"
        placeholder="Номер кабинета"
        value={s.cabinet}
        onChange={(a) =>setText(a.target.value)}
      />

      <button
        onClick={() => {
          setText('');
          onAddTask(s.text,s.cabinet);  
        }}>
        Добавить
      </button>
    </>
  );
}
